from math import *

def dfs(z):
	
	n = int(input())
	a, b = z.real, z.imag

	if n == 1:
		s = str(z).replace('(', '')
		s = str(s).replace(')', '')
		s = str(s).replace('j', 'i')
		s = s.replace('+1i', '+i')
		s = s.replace('-1i', '-i')
		
		return s
	n -= 1

	x = a
	y = b
	for i in range(n):
		x, y = x * a - y * b, y * a + x * b
	
	if x == 0:
		X = ""
	else:
		X = str(int(x))
	if y == 0:
		Y = ""
	else:
		Y = str(int(y))
	if X == "":
		s = Y + 'i'
	else:
		s = X + '+' + Y + 'i'
	s = s.replace('+-', '-')
	#print(s)
	if '+i' in s:
		s = s.replace('+i', '')
	if '-i' in s:
		s = s.replace('-i', '')
	
	s = s.replace('+1i', '+i')
	s = s.replace('-1i', '-i')
	
	return s;		

